import { Button } from "bootstrap";
import {Card} from "react-bootstrap"

function TablaBody(data){

return data.data.map((item,index)=>{
    let classActive="list-group-item";
    return(
        <div className="col-2">
            <Card>
                <ul className="list-group"> 
                <li className={classActive} key={index} >
                    <h2>{item.nombre}</h2>
                    <h3>Precio:${item.precio}</h3>
                    <Button onClick={(event)=> data.handleComida(event, item)}> Ver </Button>
                </li>
                </ul>
                
            </Card>
        </div>
  
  
    );
})
    }
   
   function TablaComidas(props){
        return TablaBody(props)
    }

    export default TablaComidas;
